import React, { useState } from 'react';
import './deep.module.css';

const Deep = () => {
  const [count, setCount] = useState(1);
  const [mouseIn, setMouseIn] = useState(false);

  const demo = () => {
    if (mouseIn) return;
    const element = document.getElementById('demo' + count);
    if (element) {
      element.classList.toggle('hover');
      setCount(prevCount => prevCount + 1);
    }
  };

  const reset = () => {
    setCount(1);
    const hovers = document.querySelectorAll('.hover');
    hovers.forEach(hover => hover.classList.remove('hover'));
  };

  document.addEventListener('mouseover', () => {
    setMouseIn(true);
    reset();
  });

  setTimeout(demo, 500);
  setTimeout(demo, 700);
  setTimeout(demo, 900);
  setTimeout(reset, 2000);
  setTimeout(demo, 2500);
  setTimeout(demo, 2750);
  setTimeout(demo, 3050);

  return (
    <nav>
      <menu>
        <li>
          <a href="#">drop</a>
          <menu>
            <li><a href="#">about</a></li>
            <li>
              <a href="#">settings</a>
              <menu>
                <li><a href="#">Test 1</a></li>
                <li><a href="#">Test 2</a></li>
                <li><a href="#">Test 3</a></li>
                <li><a href="#">Test 4</a></li>
              </menu>  
            </li>
            <li><a href="#">help</a></li>
            <li>
              <a href="#">more</a>
              <menu>
                <li>
                  <a href="#">deeper</a>
                  <menu>
                    <li><a href="#">deep 1</a></li>
                    <li><a href="#">deep 2</a></li>
                    <li><a href="#">deep 3</a></li>
                  </menu>
                </li>
                <li><a href="#">test</a></li>
              </menu>
            </li>
          </menu>
        </li>
        <li><a href="#">no drop</a></li>
      </menu>
    </nav>
  );
};

export default Deep;
